export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:h,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:h,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:i,pageSize:25,pageCount:i,total:5}}},cPCgJcCXuQ:{data:{id:575,attributes:{imdbId:"tt1438254",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTI4MjkyNDM2NV5BMl5BanBnXkFtZTcwOTExNDc0Mw@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"28%"},{Source:"Metacritic",Value:"37\u002F100"}],item_lang:{data:{id:1238,attributes:{title:j,plot:"Fatherless golden high school boy Charlie St. Cloud had a golden future, handsome, popular and admitted to Stanford on a scholarship, even recruited for a prestigious yacht sailing team. But shortly after graduating, Charlie feels existentially guilty about the death of his doting, beloved kid brother Sam whom he was driving to a playmate when a crashing car killed the junior. Charlie pledges to continue the baseball practice he promised to continue until entering Stanford, which he now ditches fro a menial job as graveyard keeper, while their mother shamelessly moved out of state, and tends to the grave of his Vietnam-killed former school buddy Sully, the second ghost who binds his sole to their beach home town. He's finally tempted to start living his own life again when he meets a female sailor his age about to embark on a transatlantic voyage and spends a ho night, but still can't 'leave Sam'. Only when he hears the authorities give up searching for her, having gone missing at sea during a storm, he misses a 'practice' at the beach when the morning canon is fired to sail hoping to save her life.",slug:"charlie-st-cloud"}}},books:{data:[{id:4105,attributes:{title:d,description:k,thumbnail:l,authors:[b],firstBook:true,published:m,publisher:f,subtitle:g}},{id:4106,attributes:{title:j,description:"Now a major motion picture • Originally published as The Death and Life of Charlie St. Cloud In a snug New England fishing village, Charlie St. Cloud tends the lawns and monuments of an ancient cemetery where his younger brother, Sam, is buried. After surviving the car accident that claimed his brother's life, Charlie is graced with an extraordinary gift: He can see, talk to, and even play catch with Sam's spirit. Into this magical world comes Tess Carroll, a captivating woman training for a solo sailing trip around the globe. Fate steers her boat into a treacherous storm that propels her into Charlie's life. Their beautiful and uncommon connection leads to a race against time and a choice between death and life, between the past and the future, between holding on and letting go — and the discovery that miracles can happen if we simply open our hearts.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QTlyR32YgJ4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2010-07-27",publisher:f,subtitle:g}},{id:4107,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:e,published:"2005-01-01",publisher:a,subtitle:a}},{id:4108,attributes:{title:d,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vHbtSAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2006-01-01",publisher:a,subtitle:a}},{id:4109,attributes:{title:d,description:k,thumbnail:l,authors:[b],firstBook:e,published:m,publisher:f,subtitle:g}}]}}},meta:{}}},prerenderedAt:1681309161015}}("","Ben Sherwood","movie","The Death and Life of Charlie St. Cloud",null,"Bantam","A Novel","series",1,"Charlie St. Cloud","The Death and Life of Charlie St. Cloud tells the haunting story of a young man who narrowly survives a terrible car wreck that kills his little brother. Years later, the brothers’ bond remains so strong that it transcends the normal boundaries separating life and death. Charlie St. Cloud lives in a snug New England fishing village. By day he tends the lawns and monuments of the ancient cemetery where his younger brother, Sam, is buried. Graced with an extraordinary gift after surviving the accident, he can still see, talk, and even play catch with Sam’s spirit. But townsfolk whisper that Charlie has never recovered from his loss. Into his carefully ordered life comes Tess Carroll, a captivating, adventuresome woman training for a solo sailing trip around the globe. Fate steers her boat into a treacherous storm that blows her back to harbor, to a charged encounter with Charlie, and to a surprise more overwhelming than the violent sea itself. Charlie and Tess discover a beautiful and uncommon connection that leads to a race against time and a desperate choice between death and life, between the past and the future, between holding on and letting go. Luminous, soulful, and filled with unforgettable characters, The Death and Life of Charlie St. Cloud is one of those rare, wise books that reveal the mysteries of the unseen world around us, gently transforming the worst pain of loss into hope, healing, and even laughter. Suspenseful and deeply moving, its startling climax reminds us that sometimes tragedies can bring about miracles if we simply open our hearts.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ppvq9LyDpvUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2004-03-02"))